import Api from "../../services/api";
import  { Component } from 'react';

const Profile = () =>{

    
    return (

        <div>
            <table className={'form'}>
                <thead>
                    <tr>
                        <th>ID</th>
                        <br/>
                        <th>NAME</th>
                        <br/>
                        <th>CRM</th>
                        <br/>
                        <th>CPF</th>
                        <br/>
                    </tr>
                </thead>
            </table>
        </div>
    );
     

    
    
}

export default Profile;
